import React from 'react';
// import { Diary } from './Diary'
import './App.css';

// const initialState: Diary[] = [
//   {
//       id: 1,
//       date: '2020-8-22',
//       title: '調子がよかった'
//   }
// ]

const App: React.FC = () => {

  return (
    <div>
      <h2 id="calendar-title"><span id="js-year"></span>年 <span id="js-month"></span>月</h2>
      <table id="calendar-table">
        <thead>
          <tr><th>日</th><th>月</th><th>火</th><th>水</th><th>木</th><th>金</th><th>土</th></tr>
        </thead>
        <tbody id="js-calendar-body"></tbody>
        </table>
    </div>
  )
}

export default App;
